import React from "react";

export function BrowserRouter({ children }) {
  return <>{children}</>;
}

export function Routes({ children }) {
  const childArray = React.Children.toArray(children);
  for (let child of childArray) {
    const path = child.props.path;
    if (path === "*") continue; // handle wildcard later
    if (path === window.location.pathname) return child.props.element || null;
    // allow root to match '/'
    if (path === "/" && window.location.pathname === "/")
      return child.props.element || null;
  }
  // If no match, check for wildcard route
  for (let child of childArray) {
    if (child.props.path === "*") return child.props.element || null;
  }
  return null;
}

export function Route() {
  // This component is handled by Routes; it should never render directly
  return null;
}
